import React from "react";

import Box from "@mui/material/Box";
import Stack from "@mui/material/Stack";
import Typography from "@mui/material/Typography";

import { useTheme } from "@mui/material/styles";

import Footer from "../Footer/Footer";

const ClassCard = () => {
  const theme = useTheme();
  const gray3 = theme.palette.gray3.main;

  return (
    <Stack spacing={2} sx={{ width: "350px" }}>
      <Box>
        <img src="./classcardimg.svg" style={{ width: "100%" }} />
      </Box>
      <Stack spacing={1} sx={{ textAlign: "left", paddingBottom: "24px" }}>
        <Stack spacing="4px">
          <Typography paragraph={true} sx={{ margin: "0", color: gray3 }}>
            Asian
          </Typography>
          <Typography
            variant="h6"
            component="h6"
            color="primary"
            sx={{ height: "70px", fontWeight: "600" }}
          >
            Sushi Salmon with Mentai
          </Typography>
        </Stack>
        <Typography
          paragraph={true}
          color="secondary"
          sx={{ fontSize: "20px", fontWeight: "600" }}
        >
          IDR 200.000
        </Typography>
      </Stack>
    </Stack>
  );
};

const ListMenuClass = () => {
  const list = Array(9).fill(0);

  return (
    <Stack spacing={10} sx={{ width: "1098px", margin: "0 auto" }}>
      <Typography
        variant="h4"
        component="h2"
        color="primary"
        sx={{ fontWeight: "600" }}
      >
        Another menu in this class
      </Typography>
      <Box
        sx={{
          display: "grid",
          gridTemplateColumns: "repeat(3, 1fr)",
          gap: "40px 24px",
        }}
      >
        {list.map((_, key) => (
          <ClassCard key={key} />
        ))}
      </Box>
    </Stack>
  );
};

const ListMenuKelasPage = () => {
  const theme = useTheme();
  const gray1 = theme.palette.gray1.main;

  return (
    <Stack spacing="141px">
      <div>
        <Box sx={{ marginBottom: "46px" }}>
          <img
            src="./listmenukelaspageimagetop.svg"
            style={{ width: "100%" }}
          />
        </Box>
        <Stack
          spacing={2}
          sx={{
            width: "1140px",
            margin: "0 auto",
            marginBottom: "132px",
            textAlign: "left",
          }}
        >
          <Typography variant="h5" component="h1" sx={{ fontWeight: "600" }}>
            Asian
          </Typography>
          <Typography paragraph={true} sx={{ color: gray1 }}>
            Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do
            eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim
            ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut
            aliquip ex ea commodo consequat. Duis aute irure dolor in
            reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla
            pariatur. Excepteur sint occaecat cupidatat non proident, sunt in
            culpa qui officia deserunt mollit anim id est laborum.
          </Typography>
        </Stack>
        <ListMenuClass />
      </div>
      <Footer />
    </Stack>
  );
};

export default ListMenuKelasPage;
export {ListMenuClass}
